import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import './App.css';
import Oyun1 from './Oyun1';

function App() {
  return (
      <Router>
        <div className="App">
          <header className="App-header">
            <p>
              Edit <code>src/App.js</code> and save to reload.
            </p>
            <Link to="/oyun1" className="App-link">
              Oyun 1
            </Link>
          </header>
        </div>

        <Switch>
          <Route path="/oyun1">
            <Oyun1 />
          </Route>
        </Switch>
      </Router>
  );
}

export default App;
